<!DOCTYPE html>
<html lang="it">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=1080, height=1920, initial-scale=1.0">
    <title>Angolo della Reciprocit√† - Michelin Experience</title>
    <link rel="preconnect" href="https://fonts.googleapis.com">
    <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
    <link href="https://fonts.googleapis.com/css2?family=Cormorant+Garamond:ital,wght@0,400;0,600;1,400&family=Montserrat:wght@300;400;600&display=swap" rel="stylesheet">
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            width: 1080px;
            height: 1920px;
            overflow: hidden;
            background-color: #1a1a1a;
            font-family: 'Montserrat', sans-serif;
        }

        .container {
            width: 100%;
            height: 100%;
            position: relative;
            overflow: hidden;
        }

        /* MEDIA HANDLING */
        .bg-layer {
            position: absolute;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            z-index: 1;
        }

        .ken-burns {
            width: 100%;
            height: 100%;
            object-fit: cover;
            animation: kenBurnsEffect 12s ease-out infinite alternate;
            transform-origin: center center;
        }

        @keyframes kenBurnsEffect {
            0% { transform: scale(1.0); }
            100% { transform: scale(1.15); }
        }

        /* OVERLAYS & ATMOSPHERE */
        .gradient-overlay {
            position: absolute;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            background: linear-gradient(
                to bottom,
                rgba(0,0,0,0.1) 0%,
                rgba(0,0,0,0.2) 40%,
                rgba(20, 10, 5, 0.7) 70%,
                rgba(10, 5, 2, 0.95) 100%
            );
            z-index: 2;
        }

        .vignette {
            position: absolute;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            background: radial-gradient(circle, transparent 50%, rgba(0,0,0,0.4) 100%);
            z-index: 3;
        }

        /* PARTICLES (Aroma/Atmosphere) */
        .particles {
            position: absolute;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            z-index: 4;
            pointer-events: none;
        }

        .particle {
            position: absolute;
            border-radius: 50%;
            background: rgba(212, 160, 99, 0.3); /* Gold/Amber faint */
            filter: blur(8px);
            animation: floatUp linear infinite;
        }

        @keyframes floatUp {
            0% { transform: translateY(0) translateX(0); opacity: 0; }
            20% { opacity: 0.5; }
            80% { opacity: 0.2; }
            100% { transform: translateY(-300px) translateX(20px); opacity: 0; }
        }

        /* CONTENT LAYOUT */
        .content-wrapper {
            position: absolute;
            z-index: 10;
            bottom: 300px; /* Respecting bottom safety area + extra for logo */
            left: 80px;
            width: 920px;
            color: #F2EFE9;
        }

        /* TYPOGRAPHY */
        .title-group {
            display: flex;
            flex-direction: column;
            gap: 20px;
        }

        h1 {
            font-family: 'Cormorant Garamond', serif;
            font-size: 120px;
            line-height: 0.95;
            font-weight: 400;
            color: #F2EFE9;
            text-shadow: 0 4px 20px rgba(0,0,0,0.3);
            opacity: 0;
            transform: translateY(40px);
            animation: textEntrance 1.2s cubic-bezier(0.215, 0.610, 0.355, 1.000) 0.5s forwards;
        }

        h1 span.accent {
            font-style: italic;
            color: #D4A063; /* Amber Gold */
        }

        .separator {
            width: 0;
            height: 4px;
            background-color: #6A3B3B; /* Brand Marsala */
            margin: 20px 0;
            animation: expandLine 1s ease-out 1.2s forwards;
        }

        h2 {
            font-family: 'Montserrat', sans-serif;
            font-size: 55px;
            font-weight: 300;
            text-transform: uppercase;
            letter-spacing: 4px;
            line-height: 1.2;
            color: #e0e0e0;
            opacity: 0;
            transform: translateY(20px);
            animation: textEntrance 1.2s cubic-bezier(0.215, 0.610, 0.355, 1.000) 1s forwards;
        }

        /* LOGO */
        .logo-wrapper {
            position: absolute;
            bottom: 120px; /* Safe zone */
            right: 80px;
            z-index: 10;
            opacity: 0;
            animation: fadeIn 1.5s ease-out 1.5s forwards;
        }

        .logo-img {
            height: 110px;
            width: auto;
            /* Invert to make it white/cream for elegance on dark bg */
            filter: brightness(0) invert(1) sepia(0.1) saturate(0.5) hue-rotate(350deg); 
        }

        /* KEYFRAMES */
        @keyframes textEntrance {
            to {
                opacity: 1;
                transform: translateY(0);
            }
        }

        @keyframes expandLine {
            to { width: 140px; }
        }

        @keyframes fadeIn {
            to { opacity: 1; }
        }

    </style>
</head>
